%spark

val conf = sc.hadoopConfiguration
val fs = org.apache.hadoop.fs.FileSystem.get(conf)
val exists = fs.exists(new org.apache.hadoop.fs.Path("/qh/qhdata/Min_Max_Checks_T2_CND"))

if(exists == false)
{
    val AP_CND = spark.read.load("s3a://DEV2DATA/qh/qhdata/Min_Max_Checks_T2_CND")
    AP_CND.createOrReplaceTempView("MIN_MAX_CND")
    AP_CND.printSchema()
}
else
{
    val AP_CND = spark.read.load("/qh/qhdata/Min_Max_Checks_T2_CND")
    AP_CND.createOrReplaceTempView("MIN_MAX_CND")
    AP_CND.printSchema()
}

